import { createIcon } from "../icon/createIcon";

export const OverflowMenuIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="OverflowMenuIcon">
    <path d="M9 7V5h2v2H9zM5 7V5h2v2H5zM1 7V5h2v2H1z" />
  </svg>,
  "OverflowMenu",
  "overflow menu"
);
